    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    outlines Refuge accomplishments from September through December of 1943. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    grazing. The public relations section of the report describes Refuge visitors and
    violations. N-R forms and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
